INSERT INTO `objective` (`obj_id`, `objective`) VALUES
(1, 'เพื่อสร้างความเป็นเลิศในการวิจัยในระดับชาติและนานาชาติทั้งด้านคุณภาพและปริมาณ'),
(2, 'เพื่อผลิตบัณฑิตที่มีคุณลักษณะพึงประสงค์ (เป็นคนดี มีปัญญา นำพาสุข)'),
(3, 'เพื่อให้มหาวิทยาลัยมหิดลมีระบบ Healthcare และบริการวิชาการ (ทั้ง Healthcare และ Non-Healthcare) ที่ได้มาตรฐานสากล'),
(4, 'เพื่อสร้างความเป็นสากลให้เกิดขึ้นทั่วทั้งมหาวิทยาลัย'),
(5, 'เพื่อให้นักศึกษาและบุคลากรเกิดการบูรณาการด้านแนวคิดในแนวทางความรับผิดชอบต่สังคมสู่ปฏิบัติ เพื่อสร้างความเข้มแข็งให้เกิดกับชุมชน/สังคม/สิ่งแวดล้อม'),
(6, 'เพื่อสร้างระบบการบริหารจัดการข้อมูล เพ่อให้มีข้อมูลที่เพียงพอต่อการนำไปใช้ในการตัดสินใจ (Direction to Management by Information)'),
(7, 'เพื่อส่งเสริมให่้เกิดการเป็น ECO University'),
(8, 'เพื่อสร้างระบบการบริหารจัดการทรัพยากรทุกประเภทอย่างมีประสิทธิภาพในการสนับสนุนการขับเคลื่อนมหาวิทยาลัย'),
(9, 'เพื่อรับความเคลื่อนมหาวิทยาลัยโดยเน้นการพัฒนาบุคลากร');
