(11120, 2554, 'โครงการจัดหาเครื่องมือวิทยาศาสตร์ทดแทน (ชุดโครงการพัฒนาโครงสร้างพื้นฐาน)', NULL, 23, 0, 2, 2, 3, 1, 1, 0, NULL, NULL, NULL, 3, 'เนื่องจากเครื่องมือวิทยาศาสตร์ที่ประจำห้องปฏิบัติการ ภาควิชาจุลชีววิทยา มีอายุการใช้งานมานานกว่า 50 ปี อุปกรณ์เครื่องมือส่วนใหญ่ทรุดโทรมมาก', NULL, NULL, '2011-10-01', '2016-09-30', '1. เพื่อจัดหาครุภัณฑ์ทดแทนครุภัณฑ์เก่าที่มีอายุการใช้งานมานานและชำรุด\r\n2. เพื่อเพิ่มประสิทธิภาพในการเรียนและการทำวิจัย', '<html />', 'คณาจารย์ / นักวิทยาศาสตร์ / นศ.ปริญญาโท-เอก', '50', 'คน', 'อาคาร 2 และอาคาร 6 ชั้น 5 คณะสาธารณสุขศาสตร์ ม.มหิดล', '', '', 90, 'kkkkkkkkkkkkkkkkkkkkk', 'อออออออออออออออออออออ', '', NULL, '2013-01-30 10:02:34', 'ph5', '', '', 'บบบบบบบบบบบบบบบบบบบ', '', ''),
