(5658583, 2556, 'โครงการพัฒนาระบบการจัดการความรู้คณะสาธารณสุขศาสตร์', NULL, 23, 0, 2, 2, 9, 9, 8, 0, NULL, NULL, NULL, NULL, '<p>พระราชกฤษฎีกาว่าด้วยหลักเกณฑ์และวิธีการบริหารกิจการบ้านเมืองที่ดี พ.ศ.2546 มาตรา 11 กำหนดไว้ว่า ส่วนราชการมีหน้าที่พัฒนาความรู้ในส่วนราชการ เพื่อให้มีลักษณะเป็นองค์กรแห่งการเรียนรู้อย่างสม่ำเสมอ โดยต้องรับรู้ข้อมูลข่าวสารและสามารถประมวลผลความรู้ในด้านต่างๆ เพื่อนำมาประยุกต์ใช้ในการปฏิบัติราชการได้อย่างถูกต้อง รวดเร็ว เหมาะสมกับสถานการณ์ รวมทั้งต้องส่งเสริมและพัฒนาความรู้ ความสามารถ สร้างวิสัยทัศน์ และปรับเปลี่ยนทัศนคติของบุคลากรในสังกัดให้เป็นบุคลากรที่มีประสิทธิภาพ และมีการเรียนรู้ร่วมกัน</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; การพัฒนาระบบการจัดการความรู้ในองค์กร เป็นการนำความรู้มาใช้พัฒนาขีดความสามารถขององค์กรให้ได้มากที่สุด โดยมีกระบวนการในการสรรหาความรู้เพื่อถ่ายทอดและแบ่งปันไปยังบุคลากรเป้าหมายได้อย่างถูกต้อง เหมาะสม เพื่อเป็นการพัฒนางาน/พัฒนาคนและพื้นฐานความรู้ขององค์กรให้มีคุณภาพและมีผลสัมฤทธิ์ในการดำเนินงานให้ดียิ่งขึ้น</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ซึ่งมหาวิทยาลัยมหิดลได้ให้ความสำคัญในการที่จะพัฒนาองค์กรให้เป็นองค์กรแห่งการเรียนรู้ จึงได้มีการศึกษาวิจัยเพื่อประเมินจากผลการประเมินองค์การแห่งการเรียนรู้ของคณะสาธารณสุขศาสตร์ โดยมหาวิทยาลัยมหิดลในโครงการวิจัย &ldquo;การวัดความเป็นองค์การแห่งการเรียนรู้ มหาวิทยาลัยมหิดล (Learning Organization) ซึ่งเป็นการวัดระดับความเป็นองค์การแห่งการเรียนรู้ของมหาวิทยาลัยมหิดลและหน่วยงานภายในมหาวิทยาลัย 57 แห่ง ตามโครงสร้างของมหาวิทยาลัย ใช้การเก็บรวบรวมข้อมูลด้วยแบบสอบถามความคิดเห็นของบุคลากรสายวิชาการและสายสนับสนุนในหน่วยงานต่างๆ จำนวน 57 แห่ง พบว่าคณะสาธารณสุขศาสตร์ได้คะแนนเฉลี่ยอยู่ในระดับปานกลาง คือ 2.94&nbsp; นอกจากนี้ ผลการประเมินการประกันคุณภาพการศึกษาของคณะสาธารณสุขศาสตร์ ปี 2552 ยังพบว่าการจัดการความรู้ของคณะยังไม่มีระบบกลไกการดำเนินการอย่างต่อเนื่อง ทำให้ได้คะแนนการประเมินต่ำ</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; การจัดการความรู้เป็นกระบวนการที่ก่อให้เกิดการแลกเปลี่ยนเรียนรู้องค์ความรู้ที่มีอยู่ในแต่ละบุคคลของประชาคมคณะสาธารณสุขศาสตร์&nbsp; โดยการจัดการความรู้เป็นเครื่องมือที่สำคัญอย่างหนึ่งของการเป็นองค์การแห่งการเรียนรู้&nbsp; เพื่อให้ประชาคมคณะสาธารณสุขศาสตร์ได้นำองค์ความรู้ที่มีมาใช้ ตลอดจนเกิดการพัฒนาและต่อยอดองค์ความรู้ จึงนำไปสู่การพัฒนางานและองค์กรได้ในที่สุด</p>\r\n<p>&nbsp;</p>\r\n<p>จากเหตุผลดังกล่าว คณะสาธารณสุขศาสตร์จึงได้จัดทำโครงการนี้ขึ้นมาเพื่อนำการจัดการความรู้มาเป็นเครื่องมือในการพัฒนาคน พัฒนางาน และพัฒนาฐานความรู้ในคณะสาธารณสุขศาสตร์&nbsp; มหาวิทยาลัยมหิดลให้มีความยั่งยืนต่อไป</p>', NULL, NULL, '2013-01-01', '2013-08-30', '<p>9.1&nbsp; เพื่อเก็บรวบรวมองค์ความรู้ของคณะสาธารณสุขศาสตร์ได้อย่างเป็นระบบ</p>\r\n<p>9.2&nbsp; เพื่อทำให้เกิดการสื่อสารสองทางระหว่างเจ้าขององค์ความรู้และผู้สนใจ</p>\r\n<p>&nbsp;</p>', '<p>&nbsp; -ไม่มี-</p>', '1.   อาจารย์คณะสาธารณสุขศาสตร์  มหาวิทยาลัยมหิดล', '150', 'คน', 'คณะสาธารณสุขศาสตร์  มหาวิทยาลัยมหิดล', '', '', 0, '', '', '', NULL, '2013-02-05 16:43:20', 'ph1', '2013-02-05 17:23:20', '', NULL, '<p>1.&nbsp; เจ้าหน้าที่งานเทคโนโลยีสารสนเทศและการประชาสัมพันธ์</p>\r\n<p>2.&nbsp; อาจารย์และเจ้าหน้าที่ทุกท่าน</p>\r\n<p>3. นักศึกษาที่สนใจ</p>\r\n<p>&nbsp;</p>', '<p>1.&nbsp; เป็นการเก็บรักษาความรู้ของคณะสาธารณสุขศาสตร์ไว้อย่างเป็นระบบ และเป็นประโยชน์ต่อบุคลากรของคณะในุ่นต่อ ๆ ไป</p>'),
(5652987, 2556, 'ก้าวไกลด้วย Elearning', NULL, 25, 0, 3, 1, 8, 10, 9, 0, NULL, NULL, NULL, NULL, '<p>การจัดการเรียนการสอนบนระบบเครือข่าย (e-learning) ได้เข้ามามีบทบาทสำคัญในยุคที่มีการใช้เทคโนโลยีสารสนเทศกันอย่างแพร่หลาย อีกทั้งระบบการศึกษาในปัจจุบันมีเป้าหมายมุ่งให้ผู้เรียนเป็นศูนย์กลาง&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; และสามารถเลือกสรรการเรียนรู้ได้ตามอัธยาศัย ได้ตลอดเวลาในทุกที่ทุกโอกาส และด้วยนโยบายของมหาวิทยาลัยมหิดลในการสนับสนุนให้ทุกหน่วยงานของมหาวิทยาลัยได้มีการพัฒนา e-learning เพื่อสนับสนุนการเรียนการสอนบนระบบเครือข่าย&nbsp; และเพื่อผลักดันให้นโยบายของมหาวิทยาลัยในการเป็น 1 ใน 100 ของมหาวิทยาลัยโลกเป็นจริงในอนาคต คณะสาธารณสุขศาสตร์จึงเสนอการการสร้างคอร์สแวร์การเรียนการสอน ผ่านสื่ออิเลคทรอนิคส์ &nbsp;เพื่อขยายโอกาสทางการเรียนรู้ของนักศึกษา อีกทั้งเพื่อบริหารทรัพยากรการศึกษาและคอร์สแวร์ที่มีอยู่ให้เกิดประโยชน์สูงสุด</p>', NULL, NULL, '2012-11-01', '2013-09-30', '<ol>\r\n<li>พัฒนาทักษะอาจารย์ด้านการสอนด้วย e-learning</li>\r\n<li>เพิ่มรายวิชาที่สอนด้วยระบบ e-learning ให้มากขึ้น</li>\r\n<li>พัฒนารายวิชาที่เข้าร่วมโครงการในปีที่ผ่านมาเพื่อให้มีการเปิดการเรียนการสอนเต็มรายวิชา</li>\r\n</ol>', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1. ปีงบประมาณ 2553 มีรายวิชาเข้าร่วมโครงการ จำนวน 14 รายวิชา</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2. ปีงบประมาณ 2554 มีรายวิชาเข้าร่วมโครงการ จำนวน 8 รายวิชา</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3. ปีงบประมาณ 2555 มีรายวิชาเข้าร่วมโครงการ จำนวน 8 รายวิชา</p>', 'กลุ่มอาจารย์เจ้าของรายวิชาเดิมที่เข้าร่วมโครงการแล้ว นำมาพัฒนาต่อ', '5', 'คน', 'บริเวณคณะสาธารณสุขศาสตร์', '', '', 0, '', '', '', NULL, '2013-02-11 09:52:14', '68', '2013-02-11 10:22:40', '', NULL, '', ''),
