(9, 11112, 'พ.ย.-ธ.ค.54', 2, 'ดำเนินการประชาสัมพันธ์ผ่านสโมสรนักศึกษาและผู้แทนจากแต่ละสาขาและภาควิชา และผ่านาสื่อ Website', 0, '', '', 0, '', ''),
(10, 11112, 'ธ.ค.-ก.ย.55', 2, 'โครงการพัฒนาศักยภาพด้านการสื่อสารระหว่างวัฒนธรรมของนักศึกษา', 0, '40000.00', '', 0, '', ''),
