(13, 11161, 'ก.พ.54 - 30 พ.ย.54', 2, 'จัดทำร่างการพัฒนาโปรแกรม เพื่อใช้ในการติดตามผลการดำเนินโครงการร่วมกันกับนักพัฒนาโปรแกรม', 0, '0', '', 0, '', ''),
(14, 11161, 'ธ.ค.54', 2, 'นำโปรแกรมที่ร่างเสร็จสมบูรณ์แล้วไปทดลองสร้างจริงเป็นโปรแกรมติดตามผลการดำเนินโครงการ', 0, '2000', '', 0, '', ''),
