(16, 11161, '1 ก.พ. - 28 ก.พ.55', 2, 'จัดทำคู่มือโปรแกรมติดตามแผนปฏิบัติการและรายงานผลการดำเนินงาน', 0, '20000', '', 0, '', ''),
