(1, 'ด้านกระบวนการ', 'ภายใต้ขั้นตอนและกระบวนการ แต่ละขั้นนั้น อะไรคือความเสี่ยงที่ส่งผลกระทบต่อการดำเนินงานในแต่ละขั้นตอน'),
(2, 'ด้านผลผลิต', 'อะไรคือความเสี่ยงที่สำคัญ ที่จะนำไปสู่การไม่บรรลุผลผลิตที่ตั้งไว้'),
(3, 'ด้านผลลัพธ์', 'อะไรคือความเสี่ยงที่สำคัญ ที่จะนำไปสู่การไม่บรรลุผลลัพธ์ที่ตั้งไว้');
INSERT INTO `section` (`sec_id`, `section`, `comment`) VALUES
(1, 'งานประจำ', 'โครงการที่บุคลากรกิจกรรมที่ปฏิบัติทุกวัน'),
(2, 'พัฒนางานประจำ', 'โครงการที่มีการปรับปรุง การเปลี่ยนแปลงกิจกรรมที่ปฏิบัติทุกวันให้สะดวก รวดเร็ว ลดขั้นตอนการปฏิบัติงานให้ดียิ่งขึ้นไปกว่าเดิม'),
(3, 'งานผลักดันยุทธศาสตร์', 'โครงการที่มีกิจกรรมเพื่อทำให้เป้าหมาย ยุทธศาสตร์ พันธกิจ และวิสัยทัศน์ของ\r\nคณะฯ และมหาวิทยาลัยบรรลุผลตามที่ตั้งใจ');
