INSERT INTO `strategic_faculty` (`sf_id`, `sf_name`, `sf_parent`, `modified`, `sf_use`) VALUES
(1, '1. สร้างเครือข่ายสู่ภาพลักษณ์ "มหาวิทยาลัยวิจัย"', 0, '', 'yes'),
(2, '2. ปรับปรุง/พัฒนาหลักสูตร และจัดการเรียนการสอนให้รองรับการเป็นสถาบันการศึกษากลุุ่ม ง.', 0, '', 'yes'),
(3, '3. พัฒนาบริการวิชาการสาธารณสุขและสิ่งแวดล้อมแบบมีส่วนร่วม', NULL, NULL, 'yes'),
(4, '4. เป็นองค์กรแห่งการเรียนรู้ มีการจัดการความรู้บุคลากรมีโอกาสก้าวกน้า มีสุขภาพดี และมีสุขภาพ', NULL, NULL, 'yes'),
(5, '5. สนับสนุนการบริหารทุกภารกิจอย่างมีประสิทธิภาพ ประหยัด โปร่งใส และส่งเสริมสิ่งแวดล้อมที่ดี', NULL, NULL, 'yes'),
(6, '6. สร้างบุคลากรและนักสึกษาให้ได้ตามค่านิยมขององค์กรและปลุกฝังค่านิยมวัฒนธรรมไทยตามหลักเศรษฐกิจพอเพียง', NULL, NULL, 'yes');
INSERT INTO `str_fac2` (`id`, `name`, `sf_id`, `sf2_use`) VALUES
(1, '1.1  ยกระดับความสำคัญของการวิจัยและงานสร้างสรรค์ให้เป็นภารกิจหลักเสมอด้วยการเรียนการสอน', 1, 'yes'),
(2, '1.2 		สร้างความเข้มแข็งการพัฒนางานวิจัยในแต่ละภาควิชา', 1, 'yes'),
(14, '3.	ผลการวิจัยสามารถนำไปใช้ประโยชน์และเผยแพร่ได้ด้วยการจดลิขสิทธิบัตร การนำองค์ความรู้ที่ได้ไปใช้ในการเรียนการสอน การตีพิมพ์ การนำเสนอในการประชุม/สัมมนาทางวิชาการได้', 1, 'yes'),
(3, '2.1  ผลิตบัณฑิตมีคุณภาพได้มาตรฐานสากล มีคุณธรรมและจริยธรรม เป็นที่ต้องการของสังคม', 2, 'yes'),
(4, '2.2  คุณภาพบัณฑิตได้มาตรฐานตามวิชาชีพ', 2, 'yes'),
(5, '2.3  คณะพัฒนาเป็นสถาบันการศึกษาเน้นการวิจัยขั้นสูง (สถาบันการศึกษา กลุ่ม ง.)', 2, 'yes'),
(6, '2.4  มีระบบการโอนย้ายหน่วยกิตกับ THAIPHEAN', 2, 'yes'),
