(15, '4.  ผลการวิจัยสามารถต่อยอดเกิดงานวิจัยใหม่ ๆ นำไปสู่การวิจัยสหสาขาวิชา', 1, 'yes'),
(16, '5. มีความร่วมมือการวิจัยระหว่างสถาบัน/องค์กร ทั้งในระดับ ชาติและระดับนานาชาติ มุ่งสู่การเป็นมหาวิทยาลัยวิจัยของมหาวิทยา ลัยมหิดลอย่างยั่งยืน', 1, 'yes'),
(17, '4.2	เสริมความรู้ที่จำเป็นให้บุคลากร(การบริหาร การวิจัย และ R2R', 4, 'yes'),
