(5, '(5) จำนวนผลงานวิจัยที่ก่อให้เกิดรายได้ หรือผลกระทบเชิงเศรษฐกิจ สังคม หรือนโยบาย', 1, 1, 'yes'),
(6, '(1)  จำนวนนักศึกษานานาชาติเต็มเวลา', 2, 3, 'yes'),
