(8, '(3)  จำนวนศิษย์เก่าที่ได้รับรางวัลระดับชาติ/นานาชาติ หรือเป็นผู้นำสูงสุดขององค์กร/ มีตำแหน่งสูงด้านสาธารณสุขในประเทศและต่างประเทศ ภายในระยเวลา 20 ปี หลังสำเร็จการศึกษา', 2, 3, 'yes'),
(9, '(4) จำนวนนักศึกษาปริญญาตรีที่เดินทางไปเรียนรู้ด้านวิชาการ/วิชาชีพในต่างประเทศ', 2, 3, 'yes'),
(10, '(5) ผู้ใช้บัณฑิตพึงพอใจตามคุณลักษณะที่พึงประสงค์หลังทำงาน 2 ปี', 2, 3, 'yes'),
(11, '(1) จำนวนใบรับรองที่หน่วยงานได้รับรองมาตรฐานคุณภาพบริการวิชาการระดับชาติหรือนานาชาติ และ/หรือ\r\n   กิจกรรมBest practice เทียบเคียงระดับนานาชาติ\r\n', 2, 7, 'yes'),
(12, '(2) จำนวนแผนงาน/โครงการบริการวิชาการที่มีความร่วมมือกับทางสถาบันภายในและต่าง\r\n  ประเทศทำให้เกิดประโยชน์ต่อชุมชน/สังคม และผู้ด้อยโอกาส\r\n', 3, 7, 'yes'),
(13, '2.  จำนวนกิจกรรม KM', 3, 17, 'yes'),
(14, '3.  คะแนนเฉลี่ย Happiness', 3, 18, 'yes'),
(15, '4.  ร้อยละของบุคลากรสายสนับสนุนที่ได้รับการเลื่อนตำแหน่งภายในเวลาที่เหมาะสม', 3, 19, 'yes'),
(16, '1. มีระบบสารสนเทศ IT \r\n   Campus เป็น Back \r\n   up  ในการทำงาน\r\n', 3, 21, 'yes'),
(17, '2. ความสำเร็จการบริหาร\r\n   ส่วนงานด้านธรรมา-\r\n   ภิบาลและประสิทธิภาพ\r\n   ระบบบริหารงาน\r\n\r\n', 3, 21, 'yes'),
(18, '•	ระดับความสำเร็จการดำเนินการตามระบบ\r\nบริหารความเสี่ยง\r\n', 4, 25, 'yes'),
(19, '1.ระดับความพึงพอใจของนักศึกษาในการพัฒนาสุนทรียภาพในมิติทางศิลปะและวัฒนธรรม', 4, 30, 'yes'),
(20, '4.2.2ร้อยละของความสำเร็จ\r\nตามเป้าหมายผลผลิต\r\n(ร้อยละ 85)', 4, 10, 'yes'),
(21, '4.3.1จำนวนชั่วโมงต่อบุคลากร\r\nที่เข้ารับการฝึกอบรมเพื่อ\r\nพัฒนาตนเอง\r\n(20 ชั่วโมง/คน)', 4, 11, 'yes'),
(22, '4.4.1ร้อยละความสำเร็จของ\r\nหน่วยงานในการลดระยะเวลาการให้บริการ\r\nของหน่วยงานบริการ\r\n(1 หน่วย/ปี)', 4, 12, 'yes');
INSERT INTO `str_goal` (`id`, `name`, `sub_str_id`, `str_id`, `sg_use`) VALUES
(1, '1. จำนวนบทความ ตีพิมพ์ในวารสาร ระดับนานาชาติ เฉลี่ย 1 บทความ ต่อบุคลากรสาย วิชาการต่อปี', 3, 1, 'yes'),
(2, '2. จำนวนดัชนีการ อ้างอิง(Citation Index) เพิ่มขึ้น 10% ต่อปี', 3, 1, 'yes'),
(3, '3. รายได้ที่เกิดจาก ทรัพย์สินทาง ปัญญญาของ มหาวิทยาลัย มหิดลเพิ่มขึ้น 5% ต่อปี', 3, 1, 'yes'),
(4, '1. จำนวนผลงานโดด เด่น/รางวัล ของ นักศึกษาและ บุคลากร', 4, 1, 'yes'),
(5, '2. อัตราการได้งาน ของบัณฑิต', 4, 1, 'yes'),
(6, '3. ผู้ใช้บัณฑิตมีความ พึงพอใจไม่ต่ำกว่า ระดับ 4ต่อ5คะแนน', 4, 1, 'yes'),
(7, '1. ร้อยละของ ผู้รับบริการที่มี ความพึงพอใจใน การบริการไม่ต่ำ กว่า ระดับ 3.75 ต่อ 5 คะแนน', 5, 1, 'yes'),
(8, '2. บุคลากรหรือ มหาวิทยาลัยได้รับ การรับรองคุณภาพ ระดับชาติหรือ นานาชาติ และ/ หรือรางวัลจากการ บริการสุขภาพใน ระดับประเทศ/โลก ทุกปี', 5, 1, 'yes'),
(9, '3. จำนวนนวัตกรรม ด้านบริการที่ เพิ่มขึ้นต่อปี', 5, 1, 'yes'),
(10, '1. มหาวิทยาลัยมหิดล ได้รับการจัดอันดับ ดีขึ้นในระดับโลก', 6, 1, 'yes');
INSERT INTO `sub_point_policy` (`sub_id`, `subname`, `poi_id`, `pol_id`, `modified`) VALUES
(1, 'เร่งรัดพัฒนาคุณภาพการศึกษาทุกระดับ ทุกประเภท ตั้งแต่ระดับการศึกษาขั้นพื้นฐาน\r\nจนถึงระดับอุดมศึกษา รวมถึงการศึกษาตลอดชีวิต พร้อมทั้งสร้างกระบวนการเรียนรู้\r\nปลูกฝังจิตสำนึก ค่านิยม คุณธรรมวัฒนธรรมตามหลักเศรษฐกิจพอเพียงแก่ผู้เรียน\r\nโดยความร่วมมือของเครือข่าย บ้าน สถาบัน ศาสนา สถานศึกษา ชุมชนและสื่อ', 1, 1, ''),
(2, 'ให้มีการปฏิรูปการเงินการคลัง เพื่อการศึกษาที่เป็นระบบอย่างจริงจัง เพื่อให้การ\r\nลงทุนด้านการศึกษา และการเรียนรู้มีความเหมาะสมยิ่งขึ้น เน้นการระดมความ\r\nร่วมมือทุกภาคส่วนเพื่อพัฒนาการศึกษา', 1, 1, ''),
(3, 'ปรับระบบการคัดเลือกเข้าศึกษาต่อระดับอุดมศึกษาให้มีความเป็นธรรม สามารถ\r\nคัดเลือกผู้เรียนได้ ศึกษาต่อตามความต้องการและความถนัดอย่างแท้จริง', 1, 1, ''),
(4, 'พัฒนาระบบบริหารจัดการและกฎหมายด้านการศึกษา โดยการส่งเสริมสนับสนุนการ\r\nกระจายอำนาจการจัดการศึกษา ส่งเสริมการมีส่วนร่วมในการจัดการศึกษา ควบคู่กับ\r\nเร่งรัดการถ่ายโอนสถานศึกษาที่ผ่าน การประเมินความพร้อมให้แก่องค์กรปกครอง\r\nส่วนท้องถิ่น พร้อมทั้งพัฒนาบุคลากร ระบบการบริหารและจัดการศึกษา การจัดการ\r\nความรู้ขององค์กรปกครองส่วนท้องถิ่นให้มีศักยภาพในการจัดการศึกษา', 1, 1, ''),
(5, 'กำหนดแผนการผลิต และพัฒนาครู คณาจารย์อย่างเป็นระบบให้สอดคล้องกับสภาพ\r\nการใช้และความ ต้องการ รวมทั้งสร้างกระบวนการในการคัดเลือกคนเก่ง คนดีเข้ามา\r\nเป็นครูโดยการสร้างสิ่งจูงใจให้เด็กเก่งสนใจเข้าเรียนต่อครูเพิ่มขึ้น อาทิ การให้ทุนการ\r\nศึกษา การสร้างความมั่นใจ ความก้าวหน้าของ อาชีพครู เช่น รายได้ค่าตอบแทนและ\r\nสวัสดิการที่มีความเหมาะสมและสามารถดำรงชีวิตได้อย่างมีศักดิ์ศรี', 2, 1, ''),
(6, 'สร้างเสริม และพัฒนาทักษะด้านการใช้เทคโนโลยีสารสนเทศ เพื่อรองรับและใช้\r\nประโยชน์ จากระบบเทคโนโลยีสารสนเทศได้อย่างคุ้มค่า', 2, 1, '');
